const Numbers = ({filteredPerson}) => {
    return(
        <div>
            <h2>Numbers</h2>
            <ul>
                {filteredPerson.map(person => <li key={person.name}>{person.name} - {person.number} <button>delete</button></li>)}
            </ul>
        </div>
    )
}

export default Numbers
